    "name": "Peter Fernandes Wanke",
    "institution": "UFRJ",
    "about": "Possui Doutorado em Engenharia de Produção pela Universidade Federal do Rio de Janeiro (2003) e Mestrado em Engenharia de Produção pela Universidade Federal do Rio de Janeiro (1998), ambos pelo PEP-COPPE/UFRJ, e Graduação em Engenharia de Produção pela Universidade Federal do Rio de Janeiro (1996) pela POLI/UFRJ. Atualmente é Professor Associado III do Instituto COPPEAD de Administração da Universidade Federal do Rio de Janeiro, onde coordena o Programa de Doutorado. Possui mais de 100 artigos publicados em journals internacionais com fator de impacto. Foi chefe de área temática do EnANPAD no biênio 2006/2007. É membro do Comitê Científico da área de Gestão de Operações e Logística do EnANPAD desde 2014. É Associate Editor do periódico Socio-Economic Planning Sciences (Elsevier) e membro do Editorial Board do periódico Tourism Economics (SAGE). Possui experiência na coordenação de projetos de pesquisa no âmbito do Centro de Estudos em Logística, Infraestrutura e Gestão (CELIG) / Cátedra Ipiranga de Estratégia de Operações do COPPEAD/UFRJ e do Programa Jovem Cientista do Nosso Estado da FAPERJ. Atualmente é coordenador do projeto de Mobilidade Urbana da FAPERJ desde 2015. Foi bolsista DTI-A do CNPq no período 01/06/2013 a 31/05/2014 analisando a eficiência dos aeroportos brasileiros. É revisor de mais de 60 periódicos nacionais e internacionais, além de consultor ad hoc da CAPES e da Câmara de Fomento à Pesquisa da Pró-reitoria de Pós-graduação e Pesquisa da UFRJ. Foi visiting scholar do Departamento de Marketing e Logística da Ohio State University (2003). Tem experiência na aplicação de técnicas de business analytics no apoio à tomada de decisão e benchmarking em diferentes áreas da administração como logística, cadeias de suprimento, transportes, infraestrutura, energia, educação e banking em diferentes países do mundo.",
