    "name": "Adriana Leiras",
    "institution": "PUC-Rio",
    "about": "É Professora Assistente do Departamento de Engenharia Industrial (DEI) da Pontifícia Universidade Católica do Rio de Janeiro - PUC-Rio, além de fundadora e coordenadora do Lab HANDs - Humanitarian Assistance and Needs for Disasters - que é o laboratório de pesquisas em Gestão de Operações em Desastres e Logística Humanitária do DEI PUC-Rio. Pós-doutora em Engenharia de Sistemas Logísticos pela Universidade de São Paulo - USP (2012), Doutora em Engenharia de Produção pela PUC-Rio (2011), Mestre em Engenharia de Produção pela PUC-Rio (2006) e Graduada em Engenharia de Produção pela PUC-Rio (2004). Realizou estágio doutoral na Universidade de Waterloo (Canadá) e estágio pós-doutoral na Universidade de Lugano (Suíça), onde parte do projeto foi desenvolvido na Etiópia em parceria com o World Food Program Ethiopia (WFP - ONU). É revisora dos periódicos POM - Production and Operations Management Journal, Journal of Humanitarian Logistics and Supply Chain Management, European Journal of Operational Research (EJOR), Transportation Research Part E: Logistics and Transportation Review (TR-E), Gestão e Produção (UFSCar), Production (São Paulo) e Transportes. Desde 2016 é bolsista FAPERJ do programa Jovem Cientista do Nosso Estado. Atua no ensino e pesquisa em Engenharia de Produção, com foco nos temas de gestão de operações em desastres e logística humanitária.",
