    "about": "Bolsista por Produtividade pelo CNPq (PQ2), Doutor em Ciência da Computação (UFRGS, 2001), Mestre em Engenharia de Produção (UFRGS, 1997), Bacharel em Matemática Aplicada e Computacional (UFRGS, 1993). Realizou estágio pós-doutoral sênior na Sungkyunkwan University, Coréia do Sul, no Semiconductor Research Institute (2011). Professor da Universidade do Vale do Rio dos Sinos (UNISINOS) desde 2005, realizando atividades de ensino e pesquisa em Graduação e em Pós-Graduação, nas escolas de Gestão e Negócios e Politécnica. Atua nos programas de Pós-Graduação em Engenharia de Produção e Sistemas e em Gestão e Negócios, nas áreas de Modelagem e Simulação de Sistemas, Métodos Multivariados de Análise, Administração e Gerência de Produção, com especial interesse na Gestão de Serviços Hospitalares. Professor da Pontifícia Universidade Católica do Rio Grande do Sul (PUC-RS) entre 1995 e 2005. Revisor das revistas International Journal of Production Research, Produção, Produto e Produção, Produção Online, e de congressos nacionais e internacionais nas áreas de Administração, Engenharia de Produção e Computação.",
